const initialState = [
  {
    id: 0,
    name: 'Nikhil Mehra',
    number: '987654321',
  },
  {
    id: 1,
    name: 'Test Number',
    number: '88368229',
  },
];

const reducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducer;
